import React, { useState } from 'react'
import { HiOutlineUser } from "react-icons/hi";

const Navbtn = (props: any) => {
  return (
      <button className="px-3 py-3 mx-5 my-2 rounded-lg hover:bg-gray-100 focus:outline-none" onClick={props.onClick}>
        {props.text}
      </button>
  )

}

const ProfileDropdown = (props: any) => {
  return (
    <div className={"flex top-16 right-0 border-4 bg-red-300" + props.class}>
      <Navbtn text="ciao"/>
      <Navbtn text="ciao"/>
      <Navbtn text="ciao"/>
    </div>
  )
}

const AppBar = (props: any) => {
  const [dropdownProfileActive, setDropdownProfileActive] = useState(false);

  return (
    <div className="relative h-16 w-max bg-white flex justify-end">
      <img className="absolute left-0 ml-5 h-16" src="https://cdn.logo.com/hotlink-ok/logo-social.png"/>
      {(
        <>
          <Navbtn text="Scopri" />
          <Navbtn text="Recensioni" />
          <Navbtn text="Classifiche" />
          <button className="px-3 py-3 mx-5 my-2 rounded-lg hover:bg-gray-100 focus:outline-none" onFocus={() => {
            setDropdownProfileActive(true)
          }}>
            <HiOutlineUser className="text-2xl"/>
          </button>
          <ProfileDropdown class=""/>
        </>
      )}
    </div>
  )
}

export default AppBar;
